import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => (
  <div className="min-h-screen p-8 bg-white">
    <h1 className="text-3xl mb-4">Welcome to Open Source Project Finder</h1>
    <p className="mb-6">Discover open-source projects that match your skills and interests.</p>
    <Link to="/search" className="bg-green-500 text-white px-5 py-2 rounded hover:bg-green-600">
      Start Searching
    </Link>
  </div>
);

export default HomePage;
